#include<iostream>
#include<vector>
using namespace std;

class Solution {
    int freq, min_time;
    string word;
    vector<vector<int>> time_grid;
    void countChar(int start, int end, int cnta, int cntb, int cntc, int tme){
        //base case
        if(cnta>=freq && cntb>=freq && cntc >= freq){
            min_time = min(tme, min_time);
            return;
        }

        if(start > end){
            return;
        }

        //rec case
        if(word[start] == 'a'){
            countChar(start+1, end, cnta+1, cntb, cntc, tme+1);
        }else if(word[start] == 'b'){
            countChar(start+1, end, cnta, cntb+1, cntc, tme+1);
        }else{
            countChar(start+1, end, cnta, cntb, cntc+1, tme+1);
        }

        if(word[end] == 'a'){
            countChar(start, end-1, cnta+1, cntb, cntc, tme+1);
        }else if(word[end] == 'b'){
            countChar(start, end-1, cnta, cntb+1, cntc, tme+1);
        }else{
            countChar(start, end-1, cnta, cntb, cntc+1, tme+1);
        }
        return;
    }

    bool countChar1(int start, int end, int cnta, int cntb, int cntc, int tme){
        //base case
        if(cnta>=freq && cntb>=freq && cntc >= freq){
            // min_time = min(tme, min_time);
            time_grid[start][end] = 0;
            // min_time = tme;
            return true;
        }

        if(start > end || tme >= time_grid[start][end]){
            return false;
        }

        //rec case
        bool found = false, found1 = false;
        if(word[start] == 'a'){
            found = countChar1(start+1, end, cnta+1, cntb, cntc, tme+1);
        }else if(word[start] == 'b'){
            found = countChar1(start+1, end, cnta, cntb+1, cntc, tme+1);
        }else{
            found = countChar1(start+1, end, cnta, cntb, cntc+1, tme+1);
        }
        if(found){
            time_grid[start][end] = min(time_grid[start][end], time_grid[start+1][end]+1);
        }

        if(word[end] == 'a'){
            found1 = countChar1(start, end-1, cnta+1, cntb, cntc, tme+1);
        }else if(word[end] == 'b'){
            found1 = countChar1(start, end-1, cnta, cntb+1, cntc, tme+1);
        }else{
            found1 = countChar1(start, end-1, cnta, cntb, cntc+1, tme+1);
        }
        if(found1){
            time_grid[start][end] = min(time_grid[start][end], time_grid[start][end-1]+1);
        }
        return found or found1;
    }
public:

    int takeCharacters(string s, int k) {
        freq = k;
        word = s;
        min_time = INT32_MAX;
        if(s.size() < 3*k){
            return -1;
        }
        time_grid = vector(s.size()+1, vector<int>(s.size()+1, INT32_MAX));
        countChar1(0, s.size()-1, 0, 0, 0, 0);
        // for(auto x: time_grid){
        //     for(auto y: x){
        //         cout << y << " ";
        //     }
        //     cout << endl;
        // }
        return time_grid[0][s.size()-1];
    }
};

int main(){
    Solution s1;
    string s = "aabaaaacaabc";
    int k = 2;
    // s = "a", k = 1;
    // s = "", k =32701;
    cout << s1.takeCharacters(s, k) << endl;
}